import React from 'react';
import Postlist from './Postlist';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import './App.css';

function App() {
  return (
    <div className="App">
    <Router>
      <Route path="`${match.url}/:id`" component={Postlist} />
    </Router>
    </div>
  );
}

export default App;
